import { NavLink } from "react-router-dom";

function Section({ title, more = false, items}) {
    return(
           <section>
               <header className="flexx item-center justify-between mb-4">
               <h3 className="text-2xl text-white font-semibold tracking-tight">{title}</h3>

               {more && (
                   <NavLink className={"text-xs hover:underline font-semibold uppercase text-link"} to={more}>
                       SEE ALL
                       </NavLink>
                       
               )}
              
               </header>
               <div className="grid grid-cols-5">
                 {items.map(item =>(

                  <NavLink key={item.title} to="/">
                      {item.name}
                  </NavLink>
                

                 ))}
               </div>
              
           </section>
    )
}
export default Section
